        "- Busca Linear: verifica os dados um a um desde o início até pesquisar os dados desejados.\n",
        "- Busca Binária: alinhe primeiro os dados em ordem numérica, compare os dados no centro do conjunto de dados com o desejado, e depois diminua a área de busca para a metade.\n",
